const staticData = getWorkflowStaticData('global');
const newIds = items.map(item => item.json["id"]);
const oldIds = staticData.oldIds; 

if (!oldIds) {
  staticData.oldIds = newIds;
  return items;
}


const ActualnewIds = newIds.filter((id) => !oldIds.includes(id));
const actualNewListing = items.filter((data) => ActualnewIds.includes(data.json['id']));
staticData.oldIds = [...ActualnewIds, ...oldIds];

return actualNewListing;
